// JavaScript
import Shader from "./Shader";
import Time from "./Time";
import Camera from "./Camera";
import Mesh from "./Mesh";
import GameObject from "./GameObject";
import EventHandler from "./EventHandler";
import GraphicsEngine from "./GraphicsEngine";

/***** Settings *****/
// Default camera position and rotation
const CAMERA_POSITION = [0.0, 100.0, 500.0];
const CAMERA_ROTATION = [-15.0, 0.0, 0.0];

// Enum struct for creating different shapes
const SHAPE = {
    CUBE: 0,
    SPHERE: 1,
    CYLINDER: 2,
    PLANE: 3
};

class Engine {
    constructor() {
        // Initialize timing variables
        this.lastTime = 0.0;
        this.frameCount = 0;
        this.fps = 0;
        this.sceneObjects = [];

        this.graphicsEngine = new GraphicsEngine(this.sceneObjects);
    }

    /*
    * @brief This is the engines main update function and is called every iteration of the main loop
    */
    run() {
        // Keeps track of time passed and delta time
        Time.update();

        // Draw all graphics
        this.graphicsEngine.run();
    }

    preload() {
        this.graphicsEngine.preload();
    }

    createGameObject (settings) {
        let mesh = new Mesh(this.mainShader);
        if (settings.shape === SHAPE.CUBE) {
            mesh.createCube();
        }
        else if (settings.shape === SHAPE.SPHERE) {
            mesh.createSphere(32);
        }
        else if (settings.shape === SHAPE.CYLINDER) {
            mesh.createCylinder(32,1);
        }
        else if (settings.shape === SHAPE.PLANE) {
            mesh.createPlane(50,50);
        }
        mesh.setColor(settings.color);

        let obj = new GameObject (settings.name, this.mainShader);
        obj.setPosition(settings.position);
        obj.setScale(settings.scale);
        obj.addMesh(mesh);

        this.sceneObjects.push(obj);
    }

    displayFrameRate() {
        let currentTime = Time.time;
        // If tNow - tLast >= 1000, one second has passed
        if ((currentTime - this.lastTime) >= 1000.0) {
            // Set text font style
            this.ctx.font = "20px Consolas";
            this.ctx.fillStyle = 'white';
            // Fps = the number of frames
            this.fps = this.frameCount;
            // Update timer
            this.lastTime = currentTime;
            // Reset frame count
            this.frameCount = 0;
            // Clear previous
            this.ctx.clearRect(0, 0, this.canvas.width, 30);
            // Draw fps and frame time in milliseconds
            this.ctx.fillText("Frame rate: " + this.fps + " fps", 10, 25);
        }
        else {
            ++this.frameCount;
        }
    }

    loadDefaultSceneObjects() {
        // Create a white sphere
        this.createGameObject({
            shape: SHAPE.SPHERE,
            name: 'Lamp',
            scale: [10.0, 10.0, 10.0],
            position: [150.0, 75.0, -150.0],
            color: [1.0, 1.0, 1.0]
        });

        // Set light position to the same as the white sphere
        this.mainShader.setLightPosition(this.sceneObjects[0].transform.position);

        // Create a red cube
        this.createGameObject({
            shape: SHAPE.CUBE,
            name: 'Red Cube',
            scale: [10.0, 10.0, 10.0],
            position: [0.0, 10.0, 0.0],
            color: [1.0, 0.0, 0.0]
        });

        // Create a green sphere
        this.createGameObject({
            shape: SHAPE.SPHERE,
            name: 'Green Sphere',
            scale: [10.0, 10.0, 10.0],
            position: [40.0, 20.0, 20.0],
            color: [0.0, 1.0, 0.0]
        });

        // Create a magenta cylinder
        this.createGameObject({
            shape: SHAPE.CYLINDER,
            name: 'Magenta Cylinder',
            scale: [10.0, 10.0, 10.0],
            position: [-40.0, 20.0, 20.0],
            color: [1.0, 0.0, 1.0]
        });

        // Create gray floor
        this.createGameObject({
            shape: SHAPE.CUBE,
            name: 'Floor',
            scale: [200.0, 1.0, 200.0],
            position: [0.0, 100.0, 0.0],
            color: [0.5, 0.5, 0.5]
        });

        // Create gray roof
        this.createGameObject({
            shape: SHAPE.CUBE,
            name: 'Roof',
            scale: [200.0, 1.0, 200.0],
            position: [0.0, 0, 0],
            color: [0.5, 0.5, 0.5]
        });

        // Create Walls
        this.createGameObject({
            shape: SHAPE.CUBE,
            name: 'Wall 01',
            scale: [1.0, 50.0, 200.0],
            position: [-200.0, 50.0, 0],
            color: [0.0, 0.0, 0.25]
        });
        this.createGameObject({
            shape: SHAPE.CUBE,
            name: 'Wall 02',
            scale: [1.0, 50.0, 200.0],
            position: [200.0, 50.0, 0],
            color: [0.0, 0.0, 0.25]
        });
        this.createGameObject({
            shape: SHAPE.CUBE,
            name: 'Wall 03',
            scale: [200.0, 50.0, 1.0],
            position: [0.0, 50.0, -200],
            color: [0.0, 0.0, 0.25]
        });
    }
}

export default Engine;
